float processModelRM(const float* input)
{
    float o1[8] = {0.f,0.f,0.f,0.f,0.f,0.f,0.f,0.f};

    for(int i = 0; i < 8; i++)
    {
        const int io = i*784;
        for(int j = 0; j < 784; j++)
            o1[i] += input[j] * aim_model_fnn_layer0[io+j];
        o1[i] = tanhf(o1[i]);
    }

    float o2 = 0.f;
    for(int i = 0; i < 8; i++)
        o2 += o1[i] * aim_model_fnn_layer1[i];

    return sigmoid(o2);
}

